import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";

const PageOne = () => {
  return (<div>PageOne<a href="/pagetwo">navigate to page two.</a></div>);
};

const PageTwo = () => {
  return (<div>PageTwo<button>Click Moi!</button></div>);
};

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <div>
          <Route path="/" exact component={PageOne} />
          <Route path="/pagetwo" component={PageTwo} />
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
